// components/AdminPanel.js
import React from 'react';

const AdminPanel = () => {
  return (
    <div>
      <h2>Panel Administracyjny</h2>
      <p>Tutaj możesz zarządzać tematami i użytkownikami.</p>
    </div>
  );
};

export default AdminPanel;
